import './Login.css';
import user_icon from '../auth/Assets/person.png';
import email_icon from '../auth/Assets/email.png';
import password_icon from '../auth/Assets/password.png';
const Login=()=>{
  return (
    <div className='login'>
        <h2>Login Form</h2>
        <div className='form-group'>
            <label htmlFor='email'>Email Address</label>
        </div>
    </div>
  )
}

export default Login
